svg.script:



//var svgG = document.querySelectorAll('#mappa-italiana > g');			
var svgG = document.querySelectorAll('svg > g');	

// Collegamento alla pagina relativa ad ogni regione
for(var x =0, gi; gi = svgG[x]; x++){
	gi.addEventListener("click", function(){ 
		var id = this.getAttribute('id');
		var collegamento = 'http://www.abcoliodoliva.com/Olivicoltori/regione_olivicoltori.php?regione=' + id;
		window.parent.location.replace(collegamento);	
	},false);
}

// Visualizzazione nome regione
for(var i =0, g; g = svgG[i]; i++){
	g.addEventListener("mouseover", function(){
		var testo = document.querySelectorAll('text');	
		var iddi = this.getAttribute('id');
		var pattern = 't-' + iddi;
		var pattern2 = 't2-' + iddi;
		this.style['fill'] = "#333"; 
 		document.getElementById(pattern).style['fill'] = "white";
		var t2 = document.getElementById(pattern2);
		if(t2)
			t2.style['fill'] = "white";
	},false);
}

// Oscuramento nome regione
for(var y =0, gg; gg = svgG[y]; y++){
	gg.addEventListener("mouseout", function(){ 
		var testo = document.querySelectorAll('text');	
		var iddi = this.getAttribute('id');
		var pattern = 't-' + iddi;
		var pattern2 = 't2-' + iddi;
		this.style['fill'] = "#009BFF"; 				 		
		document.getElementById(pattern).style['fill'] = "none";
		var tt2 = document.getElementById(pattern2);
		if(tt2)
			tt2.style['fill'] = "none";
	},false);
}


var jk =	document.getElementById("jk"); 
jk.addEventListener("click", function(){ 
	document.getElementById("az-reg").innerHTML = "Aziende registrate: 899";	
},false);
